svg.script:
// Tool position //////////////////////////////////////////////////////////////////////////////////
webMI.data.subscribe(webMI.query["ToolPosition"], function(e) {
var id = "id_bit";
var value = e.value;
return function(value) {
webMI.data.subscribe(webMI.query["WellDepth"], function(e) {
var welldepth = e.value;
var initpos = 460;
var endpos = 960;
	webMI.data.subscribe(webMI.query["ToolPosition"], function(e) {
	var id = "id_bit";
	var bitpos = e.value;
	if(welldepth==0){
		webMI.gfx.setMoveY(id, webMI.translate(0, 0, 1, initpos, endpos));
	} else if(bitpos>welldepth){
		webMI.gfx.setMoveY(id, webMI.translate(welldepth, 0, welldepth, initpos, endpos));
	} else {
		webMI.gfx.setMoveY(id, webMI.translate(bitpos, 0, welldepth, initpos, endpos));
	}
	});
});
} (value);
});

webMI.data.subscribe(webMI.query["ToolPosition"], function(e) {
var id = "id_bitlbl";
var value = e.value;
return function(value) {
webMI.data.subscribe(webMI.query["WellDepth"], function(e) {
var welldepth = e.value;
var initpos = 460;
var endpos = 960;
	webMI.data.subscribe(webMI.query["ToolPosition"], function(e) {
	var id = "id_bitlbl";
	var bitpos = e.value;
	if(welldepth==0){
		webMI.gfx.setMoveY(id, webMI.translate(0, 0, 1, initpos, endpos));
	} else if(bitpos>welldepth){
		webMI.gfx.setMoveY(id, webMI.translate(welldepth, 0, welldepth, initpos, endpos));
	} else {
		webMI.gfx.setMoveY(id, webMI.translate(bitpos, 0, welldepth, initpos, endpos));
	}
	});
});
} (value);
});
//////////////////////////////////////////////////////////////////////////////////////////////////

// Hook positiion ////////////////////////////////////////////////////////////////////////////////
webMI.data.subscribe(webMI.query["HookPosition"], function(e) {
var id = "id_hook";
var value = e.value;
webMI.gfx.setMoveY(id, webMI.translate(value, 0, 40, 400, 160));
});

webMI.data.subscribe(webMI.query["HookPosition"], function(e) {
var id = "id_hooklbl";
var value = e.value;
webMI.gfx.setMoveY(id, webMI.translate(value, 0, 40, 400, 160));
});
